    [],nt"revision_timestamp": "2016-07-27T22:41:26.694830",nt"name": "baseline-population-inventory-of-amphibians-on-the-mountain-longleaf-national-wildlife-ref",nt"isopen":
    false,nt"url": null,nt"notes": "From July of 2012 to June of 2013, we conducted
    baseline inventories for amphibians and sampled for the disease Batrachochytrium
    dendrobatidis on the Mountain Longleaf National Wildlife Refuge. Our objectives
    were to 1) quantify amphibian community structure within isolated communities identified
    as ecologically significant by the Refuge Habitat Management Plan (USFWS, 2005),
    2) determine presence/absence of Batrachochytrium dendrobatidis in the amphibian
    communities inhabiting headwater springs, seeps and other refuge aquatic habitats,
    and 3) determine the prevalence of abnormalities in frog populations on the Refuge.",nt"license_title":
